  "title": {
    "nb": "Akvakultur - lokaliteter"
  },
  "description": {
    "nb": "Datasettet Akvakultur - lokaliteter viser ca midtpunkt på alle akvakultur lokaliteter i Norge. Opplysninger om status tillatelse, samt fiskeart, type produksjon, kapasitet og formål inngår. \n\nDet vises også flater som er områder i sjø hvor det er gitt tillatelse til å drive med akvakulturvirksomhet. Flatene er tegnet basert på lokalitetenes klarerte ytterpunkt registrert i Fiskeridirektoratets akvakulturregister. \n\nDet er ikke alltid fisk eller skjell ved lokalitetene- dette kan sjekkes ved å se på Biomasse- ja/nei tema. Biomasse- ja/nei er basert på rapporter som viser opplysninger fra lokaliteten siste dag i hver måned. \n\nI tillegg er det informasjon om slettede/ nedlagte lokaliteter. Det har vært gitt tillatelse til akvakulturvirksomhet på lokalitetene på et tidspunkt, men tillatelsen er trukket tilbake og per dags dato er det ikke godkjent til bruk for akvakulturvirksomhet. De vises med status \"TT\" -Trukket tilbake, og dato for \"ikke lenger gyldig\"."
  },
  "descriptionFormatted": {
    "nb": "Datasettet Akvakultur - lokaliteter viser ca midtpunkt på alle akvakultur lokaliteter i Norge. Opplysninger om status tillatelse, samt fiskeart, type produksjon, kapasitet og formål inngår. \n\nDet vises også flater som er områder i sjø hvor det er gitt tillatelse til å drive med akvakulturvirksomhet. Flatene er tegnet basert på lokalitetenes klarerte ytterpunkt registrert i Fiskeridirektoratets akvakulturregister. \n\nDet er ikke alltid fisk eller skjell ved lokalitetene- dette kan sjekkes ved å se på Biomasse- ja/nei tema. Biomasse- ja/nei er basert på rapporter som viser opplysninger fra lokaliteten siste dag i hver måned. \n\nI tillegg er det informasjon om slettede/ nedlagte lokaliteter. Det har vært gitt tillatelse til akvakulturvirksomhet på lokalitetene på et tidspunkt, men tillatelsen er trukket tilbake og per dags dato er det ikke godkjent til bruk for akvakulturvirksomhet. De vises med status \"TT\" -Trukket tilbake, og dato for \"ikke lenger gyldig\"."
