  "title": {
    "nb": "Låssettingsplasser"
  },
  "description": {
    "nb": "En låssettingsplass er et arealavgrenset område nær strandlinjen hvor fisk oppbevares i not/notinnhengning til den er klar for levering. \nEn låssettingsplass er definert som en plass nær strandlinjen hvor topografiske og hydrografiske forhold er slik at et notsteng kan låssettes der, dvs fisken kan oppbevares i noten/ innhengningen til den er klar for omsetning.\n\nEn låssettingsplass karakteriseres av at den er godt skjermet for vær og vind, ikke har for mye strøm og har tilstrekkelig dybde, oksygen og saltholdighet."
  },
