  "description": {
    "nb": "Fiskeridirektoratets statistikkbank er en interaktiv statistikkbank for akvakultur og fiskeri. Her kan du lage dine egne tabeller og diagrammer. Datagrunnlaget i statistikkbanken er basert på Fiskeridirektoratets administrative registre og statistikkundersøkelser.Dataene kan lastes ned på ulike format (blant annet csv). Se brukerveiledning.I tillegg utgir Fiskeridirektoratet en del publikasjoner som er tilgjengelig på vår hjemmeside.Har du spørsmål om tallene eller om bruken av den selvbetjente statistikkbanken, kan du sende en e-post til statistikk@fiskeridir.no"
  },
